(91, 1, '2018-05-28 13:17:58', '2018-05-28 13:17:58', 'We’ve been delivering best-in-class innovative solutions for so long that we have developed an in-depth understanding of how the market works and what might be the next big thing. Serving a variety of enterprises from early-stage startups through to Fortune 100 corporations, we can guarantee the best results from venture capital investments.\r\n\r\nWe have access to significant funds that are ready and waiting to be invested in promising early-stage startups. However, we do much more than provide cash; we tap into our solid network of contacts in the venture capital world to ensure ideas progress smoothly from conception to reality.\r\n\r\n<a href=\"#\">Pitch your idea to us</a> and let’s work together to create something special.', 'Venture Capital', '', 'publish', 'closed', 'closed', '', 'venture-capital', '', '', '2018-05-28 13:17:58', '2018-05-28 13:17:58', '', 0, 'http://159.224.62.136:8089/?post_type=our_story&#038;p=91', 0, 'our-story', '', 0),
