(118, 1, '2018-05-28 15:20:15', '2018-05-28 15:20:15', 'Since 2001, we have developed solid expertise across a significant portfolio of technologies and industries both independently delivering successful IT projects and working as part of large distributed teams. From transport and logistics, oil and gas, hospitality and travel, media and entertainment, retail and logistics, through to R&amp;D-related verticals, such as clinical trials and HealthTech, you can be sure we have the people, expertise, and experience required to accommodate your needs.', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2018-05-28 15:20:15', '2018-05-28 15:20:15', '', 0, 'http://159.224.62.136:8089/?post_type=engineering&#038;p=118', 0, 'engineering', '', 0),
(119, 1, '2018-05-28 15:21:30', '2018-05-28 15:21:30', 'Eastern Europe has always been an attractive destination for IT outsourcing. Even if your current outsourcing strategy in Asia, Latin America, or near-shore locations has been a resounding success, you still have a lot to gain from exploring Eastern Europe as part of your next subcontracting strategy. Regardless of whether you choose to pursue outsourcing as a substitute for your existing vendors or to diversify your global footprint, you will find exactly what you’re looking for in Eastern Europe.\r\n\r\nOver the years, we’ve been home to several IT outsourcing companies and have helped them to progress from the incubation stage through to self-sustainable enterprises that employ hundreds of expert IT professionals.\r\n\r\nOutsourcing is not a sprint – it’s an enduring venture that takes dedication and commitment. Leverage the expertise we have gained over a long successful track record of managing outsourcing projects to access value-added services that streamline your workflow, make your life easier, and enhance your company’s performance. You have nothing to lose from getting in touch. Tell us what you’re looking for, and we’ll be happy to connect you with the right companies.', 'Outsourcing', '', 'publish', 'closed', 'closed', '', 'outsourcing', '', '', '2018-05-28 15:21:44', '2018-05-28 15:21:44', '', 0, 'http://159.224.62.136:8089/?post_type=engineering&#038;p=119', 0, 'engineering', '', 0),
(120, 1, '2018-05-28 15:23:19', '2018-05-28 15:23:19', 'We aim to provide world-class software engineering services to a variety of companies from different industries. Over the years, we have successfully delivered thousands of projects, produced millions of lines of code, and established long-standing relationships with a large volume of companies all over the world. It doesn’t matter if you’re a small early-stage startup or a Fortune 100 company – we have been serving clients like you since 2001.\r\n\r\nIt’s hard to imagine any modern and highly competitive technology in which Eastern Europe is yet to develop its expertise. To compete, you need to ensure you have access to the people, skills, and knowledge required to fit your project needs. When you work with us, you can be rest assured you have expertise and resources you need to accelerate software development process.\r\n\r\nTake your concepts to the next level by talking to us. <a href=\"#\">Tell us what you’re looking for</a>, and we guarantee we’ll use our skills and network to make it happen.', 'Software development', '', 'publish', 'closed', 'closed', '', 'software-development', '', '', '2018-05-28 15:23:19', '2018-05-28 15:23:19', '', 0, 'http://159.224.62.136:8089/?post_type=engineering&#038;p=120', 0, 'engineering', '', 0),
