(150, 1, '2018-05-29 21:40:56', '2018-05-29 21:40:56', '<p>Hi everyone,\r\nI’m [text* text-139 class:input-name placeholder akismet:author \"enter your name\"]. I work for [text* text-139 class:input-company-name placeholder \"company name\"]. You can reach me at [email* email-0 id:email-0 class:input-email placeholder \"email address\"].\r\nI’d like to work with your team because:\r\n</p>\r\n<div>[textarea* text-desc placeholder \"Enter a short description of your idea or any other reason you’re reaching us out\"]</div>\r\n<p>More information about myself and the company I represent are available\r\nhere: [url* url-123 class:input-url placeholder \"enter url\"]. \r\nI have also attached a few files I’d like to share with you:\r\n</p>\r\n<div class=\"fallback\">[file file limit:26214400]</div>\r\n<div class=\"dropzonetext\"><p>Drop your files below or click to upload. Maximum file size is 25Mb.</p></div>\r\n<div id=\"dropzonePreview\" class=\"dz-default dz-message\"></div>\r\n<div class=\"btn-holder\">[submit class:btn \"Let\'s do it!\"]</div>\n1\nKhiit \"[your-subject]\"\n[your-name] <wordpress@khiit.loc>\nblajnoy@gmail.com\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Khiit (http://159.224.62.136:8089)\n\n\n\n\n\nKhiit \"[your-subject]\"\nKhiit <wordpress@khiit.loc>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Khiit (http://159.224.62.136:8089)\nReply-To: blajnoy@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact Form', '', 'publish', 'closed', 'closed', '', 'contact-form', '', '', '2018-05-30 04:44:42', '2018-05-30 04:44:42', '', 0, 'http://159.224.62.136:8089/?post_type=wpcf7_contact_form&#038;p=150', 0, 'wpcf7_contact_form', '', 0),
