(171, 1, '2018-05-30 04:25:02', '2018-05-30 04:25:02', 'Over our years of operation, we have developed our own approach that takes students through all stages of the learning lifecycle to create a unique and memorable learning experience. We understand that students learn in different ways. As such, our methodology allows us to choose from a variety of learning methods that are aligned with individual learning styles or corporate training needs. We have proudly delivered high-quality training services and customized corporate training solutions to thousands of people.\r\n\r\nIf you or your company are in search of a reliable education partner, <a href=\"#\">tell us</a> what you need. We guarantee that the result will exceed your expectations.', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2018-05-30 04:25:02', '2018-05-30 04:25:02', '', 0, 'http://159.224.62.136:8089/?post_type=education&#038;p=171', 0, 'education', '', 0),
(172, 1, '2018-05-30 04:24:43', '2018-05-30 04:24:43', '', 'img_education_about', '', 'inherit', 'open', 'closed', '', 'img_education_about', '', '', '2018-05-30 04:24:43', '2018-05-30 04:24:43', '', 171, 'http://159.224.62.136:8089/wp-content/uploads/2018/05/img_education_about.jpg', 0, 'attachment', 'image/jpeg', 0),
(173, 1, '2018-05-30 04:26:35', '2018-05-30 04:26:35', 'No two students are alike – this fact has always been a key driver of the training programs we have developed during our years of operation. Either working with individuals or targeting large corporate clients, our training programs have always been tailored to the needs of every student. We have provided a variety of short-term and long-lasting training programs to thousands of people covering different technologies such as Microsoft, Oracle, IBM, Sun, SAS, Apple, and many others.\r\n\r\nTo be successful in the modern world, IT professionals need more than hard skills. Through applying our understanding of contemporary market needs, we became one of the first training providers in Eastern Europe to offer internationally recognized expertise in project management by establishing the Registered Education Provider of Project Management Institute (REP PMI). Through the REP PMI, we delivered bespoke training programs across a variety of courses related to effective communications, leadership, quality management, and many others.', 'Specialized Training', '', 'publish', 'closed', 'closed', '', 'specialized-training', '', '', '2018-05-30 04:26:35', '2018-05-30 04:26:35', '', 0, 'http://159.224.62.136:8089/?post_type=education&#038;p=173', 0, 'education', '', 0),
(174, 1, '2018-05-30 04:26:27', '2018-05-30 04:26:27', '', 'img_education_specialized_training', '', 'inherit', 'open', 'closed', '', 'img_education_specialized_training', '', '', '2018-05-30 04:26:27', '2018-05-30 04:26:27', '', 173, 'http://159.224.62.136:8089/wp-content/uploads/2018/05/img_education_specialized_training.jpg', 0, 'attachment', 'image/jpeg', 0),
(175, 1, '2018-05-30 04:27:26', '2018-05-30 04:27:26', 'The need to be at the cutting-edge of innovative developments is ingrained in our DNA. We were the pioneers of commercial distance-learning solutions in Eastern Europe. The combination of high-quality multimedia content and well-structured courses in addition to the opportunity to communicate with instructors remotely has allowed our students to easily engage with innovative ways of learning via a wide range of courses in the areas of information technologies and computer science.', 'Distance Education', '', 'publish', 'closed', 'closed', '', 'distance-education', '', '', '2018-05-30 04:28:08', '2018-05-30 04:28:08', '', 0, 'http://159.224.62.136:8089/?post_type=education&#038;p=175', 0, 'education', '', 0),
(176, 1, '2018-05-30 04:27:20', '2018-05-30 04:27:20', '', 'img_education_distance_education', '', 'inherit', 'open', 'closed', '', 'img_education_distance_education', '', '', '2018-05-30 04:27:20', '2018-05-30 04:27:20', '', 175, 'http://159.224.62.136:8089/wp-content/uploads/2018/05/img_education_distance_education.jpg', 0, 'attachment', 'image/jpeg', 0),
(177, 1, '2018-05-30 04:29:10', '2018-05-30 04:29:10', 'Creating impact by bringing world-best knowledge in innovations and technologies has long been a fundamental part of our vision. Whether we are working with independent authors to carefully develop high-quality content or partnering with world-leading publishing conglomerates, we have always been dedicated to strengthening the position of Eastern Europe in the area of professional development.\r\n\r\nThe results speak for themselves. Over our years of effective partnerships with leading publishing houses, we have delivered hundreds of books in the areas of information technologies and computer science that have progressed to reach millions of Russian-speaking readers all over the world!\r\n\r\nWhether you have the seed of an innovative idea or simply want to get a book published – get in touch with us now and tell us what you have in mind. <a href=\"#\">Let’s do this together</a>!', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2018-05-30 04:29:10', '2018-05-30 04:29:10', '', 0, 'http://159.224.62.136:8089/?post_type=publishing&#038;p=177', 0, 'publishing', '', 0),
(178, 1, '2018-05-30 04:29:04', '2018-05-30 04:29:04', '', 'img_publishing_about', '', 'inherit', 'open', 'closed', '', 'img_publishing_about', '', '', '2018-05-30 04:29:04', '2018-05-30 04:29:04', '', 177, 'http://159.224.62.136:8089/wp-content/uploads/2018/05/img_publishing_about.jpg', 0, 'attachment', 'image/jpeg', 0),
(179, 1, '2018-05-30 04:31:58', '2018-05-30 04:31:58', 'We bring innovative and high-quality content from the world to the local Eastern Europe market via our established partnerships with world-renowned players. We have worked with <a href=\"#\">Pearson</a>, <a href=\"#\">Mc-Graw</a>, <a href=\"#\">O’Reilly</a>, <a href=\"#\">Wiley</a>, <a href=\"#\">Cengage</a>, <a href=\"#\">Elsevier</a> and many others to acquire international rights, perform high-quality professional translation, and complete the full-cycle of prepress work required to deliver hundreds of IT and computer science books to Russian-speaking readers throughout the world.', 'International Rights', '', 'publish', 'closed', 'closed', '', 'international-rights', '', '', '2018-05-30 04:31:58', '2018-05-30 04:31:58', '', 0, 'http://159.224.62.136:8089/?post_type=publishing&#038;p=179', 0, 'publishing', '', 0),
(180, 1, '2018-05-30 04:31:46', '2018-05-30 04:31:46', '', 'img_publishing_international_rights', '', 'inherit', 'open', 'closed', '', 'img_publishing_international_rights', '', '', '2018-05-30 04:31:46', '2018-05-30 04:31:46', '', 179, 'http://159.224.62.136:8089/wp-content/uploads/2018/05/img_publishing_international_rights.jpg', 0, 'attachment', 'image/jpeg', 0),
(181, 1, '2018-05-30 04:33:02', '2018-05-30 04:33:02', 'Our portfolio covers a wide range of books from unique boutique-type products to bestsellers that have sold over one million copies. Finding technology, identifying the niche, defining how the book should be represented, determining the time it should be on the market – those are just a few of the challenges we have overcome to bring innovative ideas to market.\r\n\r\nAnd it doesn’t matter how unique the idea is or the way it’s produced – the constant search for a compromise between what readers need, time to market, and financial performance of each book we publish requires a high level of business competence and a deep understanding of the technologies involved.\r\n\r\nOur enthusiastic team of publishing professionals is dedicated to helping local authors make the best decisions. Tap into our advanced business competence to take your voice to people throughout the world.', 'Local Authors', '', 'publish', 'closed', 'closed', '', 'local-authors', '', '', '2018-05-30 04:33:02', '2018-05-30 04:33:02', '', 0, 'http://159.224.62.136:8089/?post_type=publishing&#038;p=181', 0, 'publishing', '', 0),
(182, 1, '2018-05-30 04:32:53', '2018-05-30 04:32:53', '', 'img_publishing_local_authors', '', 'inherit', 'open', 'closed', '', 'img_publishing_local_authors', '', '', '2018-05-30 04:32:53', '2018-05-30 04:32:53', '', 181, 'http://159.224.62.136:8089/wp-content/uploads/2018/05/img_publishing_local_authors.jpg', 0, 'attachment', 'image/jpeg', 0),
(183, 1, '2018-05-30 04:40:06', '2018-05-30 04:40:06', '', 'Publishing', '', 'publish', 'closed', 'closed', '', 'publishing', '', '', '2018-05-30 10:20:13', '2018-05-30 10:20:13', '', 0, 'http://159.224.62.136:8089/?p=183', 10, 'nav_menu_item', '', 0),
